import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Category from './Category';
import Post from './Post';

const App = () => {
  return (
    <Router>
      <div style={{ display: 'flex' }}>
        <div id="Box2" style={{ width: '20%' }}>
          <Category />
        </div>
        <div id="root" style={{ width: '80%' }}>
          <Switch>
            <Route path="/blog/:categoryName" component={Post} />
          </Switch>
        </div>
      </div>
    </Router>
  );
};

export default App;
